    false,nt"url": null,nt"notes": "This narrative report for Cold Bay Game
    Management Area and Aleutian Islands Area outlines Refuge accomplishments from May
    through August of 1949. The report begins by summarizing the weather conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
    raptors, and fish- is also covered. The Refuge development and maintenance section
    discusses physical developments. Resource management is outlined; topics include
    commercial fishing. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses and fishing. Photographs are attached.",nt"license_title": "License Not
